
public class GreaterthanLessthan {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int counter = 10;
		int like = 2;
		boolean result1 = counter > like;
		boolean result2 = counter < like;
		System.out.println("counter > like "+ result1);
		System.out.println("counter < like "+ result2 );

	}

}
